from typing import List

def getUniqueVouchers(vouchers: List[str]) -> List[str]:
    unique_vouchers = []
    seen_vouchers = set()
    for voucher in vouchers:
        if voucher in seen_vouchers:
            unique_vouchers.append(voucher)
            seen_vouchers.add(voucher)
    return unique_vouchers
